<template>
  <c-sf-gps-ds-configuration-error
    lwc:if={_sfGpsDsErrors}
    errors={_sfGpsDsErrors}
  >
  </c-sf-gps-ds-configuration-error>

  <template lwc:else>
    <c-sf-gps-ds-au-nsw-header-profile
      is-guest={isGuest}
      user-alias={userAlias}
      nav-items={_items}
      class-name={className}
      onnavigate={handleNavigate}
      onlogin={handleLogin}
    >
    </c-sf-gps-ds-au-nsw-header-profile>

    <c-sf-gps-ds-navigation-service> </c-sf-gps-ds-navigation-service>
  </template>
</template>
